import React from "react";
import "./Styles/styles.css";

export const Men = () => {
  return (
    <div className="container">
      <img
        src="https://img.modivo.cloud/product(9/2/6/b/926b76ccf2a4888a9261bc36570dec672931fde8_01_0000301902560_rz.jpg,webp)/new-balance-snikerci-pv574nd1-cinii.webp"
        alt="Avatar"
        className="image"
      />
      <div className="middle">
        <img
          alt="logo"
          className="logo"
          src="https://w7.pngwing.com/pngs/894/953/png-transparent-new-balance-brand-shoe-logo-sneakers-business-text-retail-people-thumbnail.png"
        />
      </div>
    </div>
  );
};

export default Men;
